import React, { Component } from 'react'

export default class Tr extends Component {
    render() {
        return (
            <div>
                <tr>
                    <td><input type="checkbox" /></td>
                    <td>编号</td>
                    <td>日期</td>
                    <td>失物</td>
                    <td>姓名</td>
                    <td>学号</td>
                    <td>状态</td>
                    <td>领取地址</td>
                    <td>操作</td>
                </tr>
            </div>
        )
    }
}
